import React from 'react'
// import "./Header.scss"
import Navbar from "./Navbar";
import SearchFrom from "./SearchFrom";

const Header = () => {
  return (
    <header className='header'>
      <Navbar/>
      <div className='header-content flex align-center justify-center flex-column text-center bg-dark'>
        <SearchFrom/>
        <h1 className='text-white header-title ls-2'>What are your favourite cuisines?</h1>
        <p className='text-uppercase text-white my-3 ls-1'>Personalize your experience</p>
      </div>
    </header>
  )
}

export default Header
